    private boolean isLunarNewYear(int lYear, int lMonth, int lDay, boolean isLeap) {
        int max = getDayLengthOf(lYear, lMonth, isLeap);
        if (lMonth == 0 && (lDay == 1 || lDay == 2)) {
            return true;
        }
        if (lMonth == 11 && lDay == max) {
            return true;
        }
        return false;
    }

    private boolean isChuSokHoliday(int lMonth, int lDay, boolean isLeap) {
        return !isLeap && lMonth == 7 && (lDay == 14 || lDay == 15 || lDay == 16);
    }

    private boolean isBuddhaHoliday(int lMonth, int lDay, boolean isLeap) {
        return !isLeap && lMonth == 3 && lDay == 8;
    }

    public boolean isLunarHoliday(int lYear, int lMonth, int lDay, boolean isLeap) {
        return isLunarNewYear(lYear, lMonth, lDay, isLeap) || isChuSokHoliday(lMonth, lDay, isLeap) || isBuddhaHoliday(lMonth, lDay, isLeap);
    }

